# Check if current user is Administrator
def checkUserPriviledge():
    output = os.popen('whoami /groups').readlines()
    userPriviledge = ""
    for item in output:
        if 'Mandatory Label\\' in item:
            userPriviledge = item.split("\\")[1].split(" ")[0]
    if "High" in userPriviledge:
        print("[+] User is Administrator")
    else:
        print("\n[!] current user is not admin. Please rerun as admin")
        exit(1)


# Modify RemoteRegistry DisableIdleStop Key to be 0 ->
def setDisableIdleStop():
    try:
        disableIdle_key = winreg.OpenKey(winreg.HKEY_LOCAL_MACHINE, "SOFTWARE\\Microsoft\\Windows NT\\CurrentVersion\\RemoteRegistry", 0, winreg.KEY_WRITE | winreg.KEY_WOW64_64KEY)
        winreg.SetValueEx(disableIdle_key, "DisableIdleStop", 0, winreg.REG_DWORD, 1)
        print("[+] Remote Registry Idle-Stop Disabled")
    except:
        print("\n[!] failed to write to key SOFTWARE\\Microsoft\\Windows NT\\CurrentVersion\\RemoteRegistry DisableIdleStop")
        exit(1)


# Enable Remote Registry service ->
def enableRemoteRegistry():
    try:
        os.system("sc config RemoteRegistry start= auto")
        os.system("sc start RemoteRegistry")
        print("[+] Remote Registry started")
    except:
        print("\n[!] there was an issue starting Remote Registry")
        exit(1)

