def getDaUserFromSID(daUserSID):
    try:
        output = os.popen('wmic useraccount where sid="%s" get name,sid' % daUserSID).readlines()
        output.remove("Name      SID                                            \n")
        daUser = output[1].split(' ')[0]
    except:
        print("[!] failed to get domain user from SID")
        exit(1)
    return daUser
# Get users SIDs ->
def getSID(DaUser):
    try:
        output = os.popen('wmic useraccount get name,sid').readlines()
        output = output[1:]
        for item in output:
            if DaUser in item:
                DauserSID = item.split(DaUser)[1].strip()
                return DauserSID
    except:
        print("[!] Failed to get user SID")
        exit(1)

# Write registry key to disk ->
def writeNTuserDat(data, daUser):
    try:
        os.mkdir("C:\\ProgramData\\ntuser\\")
    except:
        pass
    try:
        os.mkdir("C:\\ProgramData\\ntuser\\%s" % daUser)
    except:
        pass
    try:
        ntuserPath = 'C:\\ProgramData\\ntuser\\%s\\ntuser.dat' % daUser
        ntuserFile = open(ntuserPath, 'wb')
        ntuserFile.write(data)
        print("[+] ntuser.dat written to C:\\ProgramData\\ntuser\\%s\\ntuser.dat " % daUser)

        return ntuserPath
    except:
        print("failed to write ntuser.dat to C:\\ProgramData\\ntuser\\ntuser.dat")
        exit(1)


# Create scheduled task that loads SID and ntuser.dat into registry
# on workstation start (needs to run as admin) ->
def scheduleInjectTask(daUser, DauserSID, ntuserPath):
    try:
        # this needs to be random so the task name does not interfere with an already running task.
        taskName = "honey_session_%s" % daUser
        os.system("Powershell.exe $action = (New-ScheduledTaskAction -Execute 'reg.exe' -Argument 'load HKU\\%s %s');"
                  "$trigger = New-ScheduledTaskTrigger -AtStartup;"
                  "$task = New-ScheduledTask -Action $action -Trigger $trigger;"
                  "Register-ScheduledTask '%s' -InputObject $task" % (DauserSID, ntuserPath, taskName))
        os.system("schtasks /change /TN %s /RL HIGHEST /RU \"NT AUTHORITY\SYSTEM\"" % taskName)
        print("[+] %s scheduled" % taskName)
    except:
        print("\n[!] failed to schedule injection task")
        exit(1)

# Inject random privileged user SID into registry
def injectSID(daUser,daUserSID, ntuserPath):
    try:
        os.system('reg.exe load HKU\\%s %s' % (daUserSID, ntuserPath))
        print("[+] a session for %s has been injected!" % daUser)
    except:
        print("[!] failed to inject user SID and ntuser.dat")
        exit(1)


